freeroo2.body:
### 思路

直接模拟竖式加法，没有想到reverse，代码写的有点啰嗦

### 代码


```java
public List<Integer> addToArrayForm(int[] num, int k) {
            int length = num.length;
            List<Integer> res = new ArrayList<>();
            int plus = 0;
            int i = length - 1;
            for (; i >= 0 && k > 0; i--) {
                int t = k % 10;
                k /= 10;
                num[i] += t + plus;
                plus = 0;
                if (num[i] >= 10) {
                    plus = 1;
                    num[i] %= 10;
                }
            }
            // 如果k=0，说明k位数小于num，可能会进位
            if (k == 0) {
                if (plus == 1) {
                    while (i >= 0 && plus == 1) {
                        num[i]++;
                        plus = 0;
                        if (num[i] >= 10) {
                            plus = 1;
                            num[i] %= 10;
                        }
                        i--;
                    }
                    if (plus == 1) {
                        res.add(1);
                    }
                }
                for (int j = 0; j < length; j++) {
                    res.add(num[j]);
                }
            }
            // 如果i<0，k>0,说明k位数大于num
            else if (i < 0 && k > 0) {
                k += plus;
                Stack<Integer> st = new Stack<>();
                while (k > 0) {
                    st.add(k % 10);
                    k /= 10;
                }
                while(!st.empty()) {
                    res.add(st.pop());
                }
                for (int j = 0; j < length; j++) {
                    res.add(num[j]);
                }
            }
            return res;
        }

```

**复杂度分析**
- 时间复杂度：O(N)，其中 N 为数组长度。
- 空间复杂度：O(1)

rennzhang.body:
## 思路

### 1. “暴力解法”

作为一个算法小白，会自然而然带入平时对写业务的理解来实现，即：
- 求 num 数组实际数字总和，`[1,2,0,0]` => `1200`
- 总和加 `k`, `1200 + k`
- 转为字符串遍历，在放到新的数组中

> 但学算法应该从数据结构的特性出发

### 2. 倒序-逐个相加-进位

通过倒序遍历数组，从个位开始相加 `k`，并记录进位
-  `k` 加当前位大于 9 时，保留个位
- 处理进位，减去个位除以10（十进制）
- 处理最后位，即最终剩余进位 加`num[0]` 大于9，需要再次向前进位的情况

### 代码
```js
var addToArrayForm = function (num, k) {
  let carry = k;
  let res = [];

  for (let idx = num.length - 1; idx >= 0; idx--) {
    let cur = num[idx];
    // 向 res 数组中 push 相加后所得的个位数
    res.push((cur + carry) % 10);
    // 处理进位，减去个位除以10
    carry = Math.floor((cur + carry) / 10);
  }

  while (carry > 0) {
    res.push(carry % 10);
    carry = Math.floor(carry / 10);
  }

  return res.reverse();
};

```

### 复杂度分析

- 时间复杂度：`O(n + log(k-n))`,
- 时间复杂度：`O(n + (k - n))`

> 对于时间复杂度：遍历 `num`需要 `O(n)` 时间 ，处理多余进位的情况为`O(log(k-n))`

> 对于空间复杂度：新开了一个数组，其长度是 `n + (k - n)`, `k - n` 是最后处理剩余进位的情况

larscheng.body:
### 思路
- 从低位开始逐位相加，相加结果大于10，则当前位的数字对10取余，同时进位，收集当前位数字
- 如果k的位数大于num的长度，则按位收集剩余数字
- 将数组反转
### 代码
```java
class Solution {
    public List<Integer> addToArrayForm(int[] num, int k) {
        List<Integer> list = new ArrayList<>();

        for (int i = num.length - 1; i >= 0; i--) {
            int sum = num[i] + k % 10;
            k = k / 10;
            if (sum >= 10) {
                //进位，当前位取余数
                k++;
                sum = sum % 10;
            }
            list.add(sum);
        }
        //k位数 大于num.length
        while (k > 0) {
            list.add(k % 10);
            k = k / 10;
        }
        Collections.reverse(list);
        return list;
    }
}
```
### 复杂度
- 时间复杂度：O(n)
- 空间复杂度：O(1)

qingkediguo.body:
### 思路

将 num 填充成和 k 相同长度的数组，然后记录每次需要进位的数。按照每一位模拟计算

### 代码


```java
public List<Integer> addToArrayForm(int[] num, int k) {
    return way1(num, k);
}

private List<Integer> way1(int[] num, int k) {
    // 前面填充 0，是 num 长度和 kString 的长度一致
    int maxLength = Math.max(String.valueOf(k).length(), num.length);
    if (num.length != maxLength) {
        num = padZero(maxLength, num);
    }

    List<Integer> result = new ArrayList<>(maxLength);

    // 需要向上进位的数
    int carryNum = 0;
    for (int i = num.length - 1; i >= 0; i--) {
        // 当前位数计算需要加的值
        int addNum = num[i] + k % 10;
        k = k / 10;

        if (carryNum != 0) {
            addNum = addNum + carryNum % 10;
            carryNum = carryNum / 10;
        }
        if (addNum > 9) {
            result.add(0, addNum % 10);
            carryNum = carryNum + (addNum / 10);
        } else {
            result.add(0, addNum);
        }
    }

    // 处理没有处理完的需要进位的数
    if (carryNum != 0) {
        // 没有处理完的进位的位数
        int carryNumLength = String.valueOf(carryNum).length();
        for (int i = 0; i < carryNumLength; i++) {
            result.add(0, carryNum % 10);
            carryNum = carryNum / 10;
        }
    }

    return result;
}

private int[] padZero(int maxLength, int[] targetNum) {
    int[] num;
    int padLength = maxLength - targetNum.length;
    int[] newNum = new int[maxLength];
    for (int i = 0; i < maxLength; i++) {
        if (i < padLength) {
            newNum[i] = 0;
        } else {
            newNum[i] = targetNum[i - padLength];
        }
    }
    num = newNum;
    return num;
}
```

**复杂度分析**
- 时间复杂度：O(N)
- 空间复杂度：O(N)
